import './Banners.css';

function Banners() {
  return (
    <div className="Banners">

      <h1>KUIKA @WORLD PADEL TOUR</h1>
      <h1>BRUSSELS OPEN</h1>
      <p>Le top du Padel mondial s'apprête à enflammer Bruxelles</p>
    </div>
  );
}

export default Banners;
